create table world_subareas
(
    Id                  int           not null
        primary key,
    NameId              int unsigned  not null,
    AreaId              int           not null,
    MapsIdsCSV          mediumtext    not null,
    ShapeCSV            mediumtext    not null,
    CustomWorldMapCSV   mediumtext    not null,
    PackId              int           not null,
    Level               int unsigned  not null,
    Difficulty          int default 2 not null,
    SpawnsLimit         int default 3 not null,
    CustomSpawnInterval int unsigned  null,
    AchievementId       int           null
)
    engine = MyISAM
    charset = utf8;

